$_MODULE['<{abandonedcart}prestashop>abandonedcart_a8da2ca4ca09ffe00000d46da7e995af'] = "1. Ist es compulsary CRON zu benutzen?";
$_MODULE['<{abandonedcart}prestashop>abandonedcart_b14c240dbed0f1210b2ac554936e6e0e'] = "Wir verstehen, dass Sie mit CRON Konfiguration unbequem sein können daher dieses Modul hat eine Option aufgegebene Korbliste zu aktualisieren und manuell Erinnerung E-Mails senden. Aber wir empfehlen alle CRON zu verwenden, wie im Fall von großer Menge von verlassenen Wagen, ist es nicht möglich, für die Admin-E-Mails manuell zu senden.";
$_MODULE['<{abandonedcart}prestashop>abandonedcart_eff86ce34f4a739ff555036ab6f7101d'] = "2. Wie werde ich wissen, wenn einige Kunden Plätze bestellen Gutscheincode von verlassenen Warenkorb E-Mail?";
$_MODULE['<{abandonedcart}prestashop>abandonedcart_6c7ca1ce8e7ab2491e99ed3406a93dc8'] = "Sie können vollständig überprüfen, um Informationen dieser Kunden in \ „Converted Listen \“ -Reiter unseren Admin-Panel.";
$_MODULE['<{abandonedcart}prestashop>abandonedcart_28727f700ceb02e82f02249fa100bd1d'] = "3. Ist es compulsary \ „auffrischen Warenkorb bei Login \“ zu aktivieren?";
$_MODULE['<{abandonedcart}prestashop>abandonedcart_dcfa8eb88fb8024263c6f630cd9d37f1'] = "Nein, ist es nicht obligatorisch, aber es ist ein Nachteil und 0 Nutzen zu ermöglichen es daher nicht ist es sehr empfohlen, zu ermöglichen.";
$_MODULE['<{abandonedcart}prestashop>abandonedcart_128f6bce42c3eb12dfeed41faaaddfd8'] = "Wenn ein Kunde-Logins zu Ihrem Geschäft, wird er nicht seine zuvor hinzugefügten Produkte im Warenkorb finden und jedes Mal abandones er einen Wagen, wird ein neuer Eintrag für ihn in verlassenen Korbliste gemacht werden.";
$_MODULE['<{abandonedcart}prestashop>abandonedcart_d52dd9d760e4dc9d68cbf1da18e002f5'] = "4. Wie viele serielle Erinnerungen sollte ich ein Setup für das beste Ergebnis?";
$_MODULE['<{abandonedcart}prestashop>abandonedcart_6177df7e9fa2b783a8aa7f39e02cbbdf'] = "Es wurde festgestellt, dass drei verlassenen Warenkorb Nachrichten der Umsatz um 56 Prozent gesteigert werden, im Vergleich zu nur einem Senden aber es gibt keine feste Regel dafür. Testen ist immer ein bester Weg, um zu bestimmen, was für Sie am besten paßt.";
$_MODULE['<{abandonedcart}prestashop>abandonedcart_4ace9425d75464a2110001a6096acdbb'] = "5. Ich brauche Ihre Hilfe, kann ich Sie kontaktieren?";
$_MODULE['<{abandonedcart}prestashop>abandonedcart_9d32d737e383d7638ebb142f5fef03cd'] = "Ja, wenn Sie irgendeine Frage haben oder eine Frage, die sich, zögern Sie nicht, ein Ticket für das gleiche zu erhöhen.";
